const FizzBuzz = (num) =>  {	
	(number % 3 === 0 && number % 5 === 0) ?
		"fizzBuzz" : (number % 5 === 0 ?
				"buzz" : (number % 3 === 0 ?
					"fizz" : number)
					)
};
export default FizzBuzz;
